import React from 'react';
import styles from './CaseStudySolution.module.css';

function CaseStudySolution({ title, description1, description2, image }) {
  return (
    <section className={styles.solutionSection}>
      <h3 className={styles.solutionLabel}>SOLUTION</h3>
      <div className={styles.solutionContent}>
        <div className={styles.solutionText}>
          <h2 className={styles.solutionTitle}>{title}</h2>
          <p>{description1}</p>
          <p>{description2}</p>
        </div>
        <div className={styles.solutionImage}>
          <img src={image} alt="Digital Styleguide" />
        </div>
      </div>
    </section>
  );
}

export default CaseStudySolution;
